import React from 'react';
import './App.css';
import Header from './Header'
import Footer from './Footer'
import Item from './Item';
import todoData from './todoData'

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      todos: []
    }
  }
  render() {
    const todoItems = todoData.map(item => <Item key={item.id} item={item}/>)
    return (
      <div className="App">
        <Header />
        <p>
          {todoItems}
        </p>
        <Footer />
      </div>
    );
  }

}

export default App;
